import React from 'react';
import '../../styling/Task.css';

function Task(props) {
    return (
        <div className="Task">
            <div className="TaskTitle">
                {props.title}

            </div>
            <div className="Specific">
                sdasda
            </div>
            <div className="Measurable">
                sdasda
            </div>
            <div className="Achievable">
                sdasda
            </div>
            <div className="Relevant">
                sdasda
            </div>
            <div className="Status">
                sdasda
            </div>
        </div>
    );
}

export default Task;
